Exclusivity:
['CEIS hereby grants XFN and its      Affiliates an exclusive license (free of all third-party liens, claims and      encumbrances) to, and to permit others to, during the Term in the      Territory:<omitted>(a)  store or cache the Content in one or more host computers controlled           directly or indirectly by XFN or its Affiliates;

     (b)  adapt, translate, modify, reproduce, copy, amend, revise or encode the           Content; and

     (c)  publish, broadcast, distribute, re-distribute, transmit, display, make           available to the public or otherwise exploit the Content in any manner           by any device or in media now or hereafter known.', "During the Term, CEIS agrees not to appoint any other licensees for the      distribution of the Content in the People's Republic of China."]

['Subject to the terms and conditions of this Agreement, Zogenix hereby appoints Distributor, and Distributor accepts appointment, as the exclusive distributor (even as to Zogenix) of the Product in the Field in the Territory during the Term, and grants to Distributor the exclusive rights to maintain Regulatory Approval of (while Distributor is the MAH Party), package, promote, market, offer for sale, sell, import and distribute the Product in the Field in the Territory during the Term', "During the Term, Zogenix shall retain and have the sole and exclusive right to supply or have supplied all of Distributors' and its Affiliates' and Sub-distributors' requirements of the Product for sale in the Field in the Territory.", 'Distributor hereby grants Zogenix an irrevocable, perpetual, royalty-free, fully paid-up, exclusive license with the right to grant sublicenses to use such Data solely generated and co-owned by Distributor outside of the Territory and a co-exclusive license in the Territory upon expiration or termination of the Agreement.', 'Distributor shall have the exclusive right to market, promote, sell, offer for sale, import, package and otherwise Commercialize the Product in the Field in the Territory, at its sole cost and expense, in accordance with Applicable Laws and the Commercialization Plan and subject to the terms and conditions of this Agreement.', "Zogenix shall supply (or have supplied) to Distributor, in accordance with the terms set forth on Exhibit 2.3, and Distributor shall purchase exclusively from Zogenix, Distributor's and its Affiliates' and Sub- distributors' Unlabeled Drug Product requirements of the Product for sale by Distributor or its Affiliates or Sub-distributors in the Territory in the Field, subject to and under the provisions of Section 5.2 and the Supply Agreement.", 'Without limiting the foregoing, Distributor will have the exclusive right and responsibility in the Field in the Territory for the following:

(i) designing the Commercialization strategy and tactics for the Product, subject to JSC approval of the Commercialization Plan;

(ii) undertaking all promotional activities for the Product;<omitted>(iii) establishing and implementing post-marketing surveillance studies for the Product in the Territory as required or recommended by a Regulatory Authority;

(iv) receiving, accepting and filling orders for the Product from customers;

(v) warehousing and distributing the Product to customers;

(vi) controlling invoicing, order processing and collection of accounts receivable for sales of the Product;

(vii) recording sales of the Product in the Territory in its books of account for sales; and

(viii) providing results of sales of the Product in the Territory for purposes of periodic safety reports and exposure estimates.']
